    @include bx--snippet;

    min-width: rem(320px);
    max-width: rem(760px);
    height: $carbon--spacing-08;
    padding-right: $carbon--spacing-08;
  }

  .#{$prefix}--snippet--single.#{$prefix}--snippet--no-copy {
    padding: 0;

    &::after {
      right: $carbon--spacing-05;
    }
