/// @access private
/// @group notification
@mixin inline-notification--color($color) {
  border: 1px solid $color;
  border-left: 6px solid $color;

  .#{$prefix}--inline-notification__icon {
    fill: $color;
  }
}

//----------------------------------------------
// Toast Notification
// ---------------------------------------------

/// @access private
/// @group notification
@mixin notification--color($color) {
  border-left: 6px solid $color;
}

/// @access private
