/// Toolbar styles
/// @access private
/// @group toolbar
@mixin toolbar {
  .#{$prefix}--toolbar {
    display: flex;
    flex-flow: row nowrap;
    align-items: center;
    margin: 1rem 0;

    > div {
      margin: 0 rem(4px);
    }

    .#{$prefix}--search-input {
      height: rem(32px);
      background-color: transparent;
      outline: none;
    }

    .#{$prefix}--search-close {
      display: none;
    }

    .#{$prefix}--overflow-menu__icon {
      transition: fill 50ms $carbon--standard-easing;
      fill: $text-02;
    }

    .#{$prefix}--search-magnifier {
      top: rem(8px);
      left: rem(6px);
      transform: scale(1.15);
      cursor: pointer;
      transition: all 175ms $carbon--standard-easing;
      fill: $text-02;
    }

    fieldset {
      padding: 0;
      border: 0;
    }

    .#{$prefix}--toolbar-search--active {
      width: rem(250px);

      .#{$prefix}--search-magnifier {
        top: rem(9px);
        transform: scale(1);
      }

      .#{$prefix}--search-input {
        background-color: $field-02;
      }

      .#{$prefix}--search-close {
        display: block;
      }
    }

    .#{$prefix}--checkbox-label {
      margin-bottom: 0;
    }

    .#{$prefix}--overflow-menu--open > .#{$prefix}--overflow-menu__icon {
      fill: $brand-01;
    }
  }

  .#{$prefix}--toolbar-search {
    width: 1.8rem;
    transition: all 175ms $carbon--standard-easing;
  }

  .#{$prefix}--toolbar-search__btn {
    position: absolute;
    top: 0;
    left: 0;
    width: rem(32px);
    height: rem(32px);
    background: transparent;
    border: 0;

    &:focus {
      @include focus-outline;
    }
  }

  .#{$prefix}--toolbar-filter-icon {
    padding-right: 0;
    padding-left: 0;
  }

  .#{$prefix}--toolbar-menu__title {
    @include type-style('caption-01');

    padding: 0.5rem 1.25rem;
    font-weight: 600;
  }

  .#{$prefix}--toolbar-menu__option {
    padding: 0.5rem 1.25rem;
  }

  .#{$prefix}--toolbar-menu__divider {
    width: 100%;
    border: 0;
    border-top: 1px solid $ui-03;
  }

  .#{$prefix}--radio-button-group {
    border: none;
  }

  .#{$prefix}--toolbar-search:not(.#{$prefix}--toolbar-search--active)
    .#{$prefix}--search-input {
    border-bottom: none;
  }
}

@include exports('toolbar') {
  @include toolbar;
}

